import axios from 'axios';

const INTERCEPTS_URL = 'intercepts';


class InterceptsService {

    getIntercepts() {
        console.log(INTERCEPTS_URL);
        return axios.get(INTERCEPTS_URL);
    }
}

export default new InterceptsService();
